import React from "react";
import ContainerSummaryCard from "../../components/admin/dashboard/ContainerSummaryCard";

/**
 * User Racks page — readonly list of racks (same summary card).
 * Props:
 *  - containers
 */
const UserRacks = ({ containers = [] }) => {
  return (
    <div className="container my-4">
      <h2 className="fw-bold mb-3">Racks (View Item)</h2>
      <p className="text-muted">Browse racks and slots.</p>

      <div className="row g-3">
        {containers.map((c) => (
          <div key={c.id} className="col-12 col-sm-6 col-lg-4">
            <ContainerSummaryCard container={c} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default UserRacks;
